import './filter.css';

const Filter =()=>{
    return(
   <section className = "container ">
        <div className = "row">
            <div className = "col text-center my-2">
                <h1 className = "fs-2 color">Busqueda abanzada</h1>
                <div className = "underline mx-auto mt-3"></div>
            </div>
        </div>

        <div className = "row mt-3 mb-4 button-group filter-button-group">
            <div className = "col d-flex justify-content-center">
                <button type = "button" data-filter = "*" class = "btn btn-primary mx-1 text-dark">All</button>
                <button type = "button" data-filter = ".electronic" class = "btn btn-primary mx-1 text-dark">Electronic</button>
                <button type = "button" data-filter = ".clothing" class = "btn btn-primary mx-1 text-dark">Clothing</button>
                <button type = "button" data-filter = ".furniture" class = "btn btn-primary mx-1 text-dark">Furniture</button>
            </div>
        </div>
    </section>
);
}
export default Filter;
